import React, { Component } from 'react';
import {Route , Switch , Redirect} from "react-router-dom";
import NavBar from './navbar';
import Home from './home';
import AboutUs from './aboutus';
import Contacts from './contacts';
import ShoppingCart from './shoppingCart';


import apple from '../img/apple.jpg';
import broccoli from '../img/broccoli.jpg';
import cabbage from '../img/Cabbage.jpg';
import carrots from '../img/carrots.jpg';
import cucumber from '../img/cucumber.jpg';
import eggplant from '../img/eggplant.jpg';
import lettuce from '../img/lettuce.jpg';
import okra from '../img/okra.jpg';
import tomato from '../img/tomato.jpg';
import papper from '../img/papper.jpg';
import peas from '../img/peas.jpg';
import onion from '../img/onion.jpg';

class App extends Component {
    state = { 
        products:[
            {id:1,name:"apple",price:10,img:{apple}},
            {id:2,name:"broccoli",price:10,img:{broccoli}},
            {id:3,name:"cabbage",price:10,img:{cabbage}},
            {id:4,name:"carrots",price:10,img:{carrots}},
            {id:5,name:"cucumber",price:10,img:{cucumber}},
            {id:6,name:"eggplant",price:10,img:{eggplant}},
            {id:7,name:"papper",price:10,img:{papper}},
            {id:8,name:"lettuce",price:10,img:{lettuce}},
            {id:9,name:"okra",price:10,img:{okra}},
            {id:10,name:"peas",price:10,img:{peas}},
            {id:11,name:"tomato",price:10,img:{tomato}},
            {id:12,name:"onion",price:10,img:{onion}},
        ]
     }
    render() { 
        return ( 
            <React.Fragment>
                <NavBar/>
                <main className="container">
                <Switch>
                    <Route path='/home' component={Home}/>
                    <Route path='/aboutus' component={AboutUs}/>
                    <Route path='/contacts' component={Contacts}/>
                    <Route path='/shoppingCart' component={ShoppingCart}/>
                    <Route path='/products' component={Products}/>
                    {/*<Redirect to='/notFound'/>*/}
                    <Redirect from='/' to='/home'/>
                </Switch>
                </main>
            </React.Fragment>
        );
    }
}
 
export default App;
